import styled from 'styled-components';

export const Result = styled.p`
    color: #000000;
    font-family: "poppins";
    font-size: 30px;
`;
export const ResultContainer = styled.div`
    display: flex;
    justify-content: center;
    align-items:center;
    width: 100%;
    height: 10%;
`;
